INSERT INTO `parametroconsulta` VALUES (1,'Carga Stage Cartaz','SELECT \n	LOWER(REPLACE(REPLACE(RIGHT(f.Nome, 13),\'_.jpg\', \'\'),\'_\',\' \')) AS \'Id_cartaz\'\n    ,d.HashID\n    ,d.Data AS \'Data_documento\'\n    ,UPPER(p.Genero) AS \'Id_genero\'\n    ,CASE f.Dispositivo\n		WHEN \'saida\' THEN REPLACE(UPPER(f.Dispositivo),\'I\',\'Í\')\n        WHEN \'entrada\' THEN UPPER(f.Dispositivo)\n        END AS \'Id_dispositivo\'\nFROM Foto f\nLEFT JOIN Documento d\n	ON d.ID = f.ID_Foto_Documento\nLEFT JOIN Pessoa p\n	ON p.ID_Pessoa_Documento = d.ID\nLEFT JOIN plum_dw.fat_cartaz fat\n	ON fat.HashID = d.HashID\n	AND fat.Data_documento = d.Data\nWHERE fat.ID IS NULL'),(2,'Carga Stage Documento','SELECT\n	d.HashID\n    ,d.Data AS \'Data_documento\'\n    ,CASE f.Dispositivo\n		WHEN \'saida\' THEN REPLACE(UPPER(f.Dispositivo),\'I\',\'Í\')\n        WHEN \'entrada\' THEN UPPER(f.Dispositivo)\n        END AS \'Id_dispositivo\'\n	,f.Nome\n    ,f.Largura\n    ,f.Altura\n    ,f.Local\n    ,f.Imagem\nFROM Documento d\nLEFT JOIN Foto f\n	ON f.ID_Foto_Documento = d.ID\nLEFT JOIN plum_dw.fat_documento fat\n	ON fat.HashID = d.HashID\n	AND fat.Data_documento = d.Data\nWHERE fat.ID IS NULL'),(3,'Carga Stage Pessoa','SELECT\n	d.HashID\n    ,d.Data AS \'Data_documento\'\n    ,UPPER(p.Genero) AS \'Id_genero\'\n    ,p.Confianca_G\n    ,p.Idade\n    ,p.Confianca_I\n    ,CASE f.Dispositivo\n		WHEN \'saida\' THEN REPLACE(UPPER(f.Dispositivo),\'I\',\'Í\')\n        WHEN \'entrada\' THEN UPPER(f.Dispositivo)\n        END AS \'Id_dispositivo\'\n	,f.Imagem\nFROM Documento d\nLEFT JOIN Pessoa p\n	ON p.ID_Pessoa_Documento = d.ID\nLEFT JOIN Foto f\n	ON f.ID_Foto_Documento = d.ID\nLEFT JOIN plum_dw.fat_pessoa fat\n	ON fat.HashID = d.HashID\n	AND fat.Data_documento = d.Data\nWHERE fat.ID IS NULL'),(4,'Carga Stage Sentimento','SELECT\n	UPPER(s.Descricao) AS \'Id_emocao\'\n    ,s.Valor\n    ,s.Confianca\n    ,d.HashID\n    ,d.Data AS \'Data_documento\'\n    ,UPPER(p.Genero) AS \'Id_genero\'\n    ,CASE f.Dispositivo\n		WHEN \'saida\' THEN REPLACE(UPPER(f.Dispositivo),\'I\',\'Í\')\n        WHEN \'entrada\' THEN UPPER(f.Dispositivo)\n        END AS \'Id_dispositivo\'\nFROM Sentimento s\nLEFT JOIN Documento d\n	ON d.ID = s.ID_Sentimento_Documento\nLEFT JOIN Pessoa p\n	ON p.ID_Pessoa_Documento = d.ID\nLEFT JOIN Foto f\n	ON f.ID_Foto_Documento = d.ID\nLEFT JOIN plum_dw.fat_sentimento fat\n	ON fat.HashID = d.HashID\n	AND fat.Data_documento = d.Data\nWHERE fat.ID IS NULL'),(5,'Carga Fato Cartaz','SELECT\n	fat.ID\n	,dim_c.ID_cartaz\n    ,stg.HashID\n    ,stg.Data_documento\n    ,DATE(stg.Data_documento) AS Data\n    ,HOUR(stg.Data_documento) AS Hora_documento\n    ,MINUTE(stg.Data_documento) AS Minuto_documento\n    ,dim_g.Id_genero\n    ,dim_d.Id_dispositivo\nFROM stg_cartaz stg\nLEFT JOIN dim_cartaz dim_c\n	ON dim_c.Descricao_cartaz = stg.ID_cartaz\nLEFT JOIN dim_genero dim_g\n	ON dim_g.Descricao_genero = stg.Id_genero\nLEFT JOIN dim_dispositivo dim_d\n	ON dim_d.Descricao_dispositivo = stg.Id_dispositivo\nLEFT JOIN fat_cartaz fat\n	ON fat.ID_cartaz = dim_c.ID_cartaz\n    AND fat.HashID = stg.HashID\n    AND fat.Data_documento = stg.Data_documento\n    AND fat.ID IS NULL'),(6,'Carga Fato Documento','SELECT\n	fat.ID\n    ,stg.HashID\n	,stg.Data_documento\n    ,DATE(stg.Data_documento) AS Data\n    ,HOUR(stg.Data_documento) AS Hora_documento\n    ,MINUTE(stg.Data_documento) AS Minuto_documento\n    ,dim_d.Id_dispositivo\n    ,stg.Nome\n    ,stg.Largura\n    ,stg.Altura\n    ,stg.Local\n    ,stg.Imagem\nFROM stg_documento stg\nLEFT JOIN dim_dispositivo dim_d\n	ON dim_d.Descricao_dispositivo = stg.Id_dispositivo\nLEFT JOIN fat_documento fat\n	ON fat.HashID = stg.HashID\n    AND fat.Data_documento = stg.Data_documento\n    AND fat.ID IS NULL'),(7,'Carga Fato Pessoa','SELECT\n	fat.ID\n    ,stg.HashID\n    ,stg.Data_documento\n    ,DATE(stg.Data_documento) AS Data\n    ,HOUR(stg.Data_documento) AS Hora_documento\n    ,MINUTE(stg.Data_documento) AS Minuto_documento\n    ,dim_g.Id_genero\n    ,stg.Confianca_G\n    ,stg.Idade\n    ,stg.Confianca_I\n    ,dim_d.Id_dispositivo\n    ,stg.Imagem\nFROM stg_pessoa stg\nLEFT JOIN dim_genero dim_g\n	ON dim_g.Descricao_genero = stg.Id_genero\nLEFT JOIN dim_dispositivo dim_d\n	ON dim_d.Descricao_dispositivo = stg.Id_dispositivo\nLEFT JOIN fat_pessoa fat\n	ON fat.HashID = stg.HashID\n    AND fat.Data_documento = stg.Data_documento\n    AND fat.ID IS NULL'),(8,'Carga Fato Sentimento','SELECT\n	fat.ID\n    ,dim_e.Id_emocao\n    ,stg.valor\n    ,stg.Confianca\n    ,stg.HashID\n    ,stg.Data_documento\n    ,DATE(stg.Data_documento) AS Data\n    ,HOUR(stg.Data_documento) AS Hora_documento\n    ,MINUTE(stg.Data_documento) AS Minuto_documento\n    ,dim_g.Id_genero\n    ,dim_d.Id_dispositivo\nFROM stg_sentimento stg\nLEFT JOIN dim_emocao dim_e\n	ON dim_e.Descricao_emocao = stg.Id_emocao\nLEFT JOIN dim_genero dim_g\n	ON dim_g.Descricao_genero = stg.Id_genero\nLEFT JOIN dim_dispositivo dim_d\n	ON dim_d.Descricao_dispositivo = stg.Id_dispositivo\nLEFT JOIN fat_sentimento fat\n	ON fat.Id_emocao = dim_e.Id_emocao\n    AND fat.HashID = stg.HashID\n    AND fat.Data_documento = stg.Data_documento\n    AND fat.ID IS NULL');
